INSERT INTO `mbti_kelas` VALUES (1, 'Business Analyst', '<p><strong>Busines Analyst</strong>&nbsp;adalah seorang yang bertanggung jawab dalam menerima &amp; mengumpulkan informasi business problem dari client dan stakeholder, menganalisanya dan kemudian menterjemahkan hasil analisa kedalam bentuk spesifikasi dokumen (FSD) untuk disetujui oleh pihak client dan stakeholder, dan dapat dimengerti oleh programmer.</p>\r\n\r\n<p>Pada Industri IT dan Sistem Informasi, lingkup bisnis problem sering kali mencakup komponen pengembangan sistem, namun mungkin juga terdiri dari perbaikan proses atau perubahan organisasi. Business analysis juga dapat dilakukan untuk memahami keadaan organisasi saat ini, untuk dijadikan dasar identifikasi kebutuhan bisnis. Namun, dalam kebanyakan kasus, Business Analysis dilakukan untuk menentukan dan memvalidasi solusi yang memenuhi kebutuhan bisnis, sasaran, atau tujuan.<br />\r\nKelihatannya simple dan jobdesknya gg ribet deh, tapi eitss jangan salah, banyak kejadian ketika si BA ini salah menginterpretasikan maksud &amp; tujuan dari client dan malah bikin spesifikasinya semakin nggak jelas, dan dokumen yang dibuat tidak dapat dimengerti oleh programmer, ihhh kan bahaya banget. Maka dari itu, ada beberapa kriteria atau skill yang harus dipenuhi jika kamu ingin jadi seorang BA.</p>\r\n\r\n<h2>Pengertian dan Tugas seorang Business Analyst</h2>\r\n\r\n<ol>\r\n	<li>\r\n	<h3><strong>BUSINESS PROCESS</strong></h3>\r\n\r\n	<p>Seorang BA harus ahli dalam modeling atau mapping tentang bisnis proses. Bukan modeling pragawan/ti yaa.. tapi tetep ga pindah jalur dari bidang IT. Misalnya si BA ini harus mahir dalam menggunakan tools untuk mempermudah pekerjaannya seperti Visio, Rational Rose, Ideas Modeler etc. Jadi tetep, bisnis proses adalah salah satu dasar utama yang harus seorang BA mengerti dalam suatu project.</p>\r\n	</li>\r\n	<li>\r\n	<h3><strong>Dapat menjadi pendengar yang baik.</strong></h3>\r\n\r\n	<p>Seorang business analyst dituntut untuk dapat mendengarkan dan menangkap intisari atau maksud dari pembahasan yang dilakukan oleh client maupun stake holder, agar requirement yang didapat atau yang nantinya akan dituang kedalam dokumen tidak melenceng dari apa yang sudah disepakati bersama oleh client maupun stakeholder.</p>\r\n	</li>\r\n	<li>\r\n	<h3><strong>Interviewer dan Proaktif</strong></h3>\r\n\r\n	<p>Seorang business analyst selain menjadi pendengar yang baik, juga dituntut untuk menjadi seorang interviewer agar membuat client maupun stakeholder mengeluarkan pendapat mereka untuk mencapai tujuan bersama. Proaktif dibutuhkan jika terdapat bahan atau dokumen yang dirasa belum lengkap, ada yang tidak jelas, maka seorang BA harus dapat mengejar dan followup terkait dengan kekurangannya tersebut.</p>\r\n	</li>\r\n	<li>\r\n	<h3><strong>Dapat membuat Design Mockup maupun Wireframe</strong></h3>\r\n\r\n	<p>Loh koq BA juga harus bisa memubuat Design Mockup/Wireframe? Bukannya sudah ada ya bagiannya yang bikin begituan? Eiitttss, memang betul untuk membuat sebuah design Mockup maupun Wireframe sudah ada bagiannya, tapi yang perlu digaris bawahi adalah yang tau keinginan atau requirement dari client maupun stakeholder adalah BA, maka dari itu seorang BA juga dituntut setidaknya dapat membuat design mokup maupun wireframe. Biasanya tools yang digunakan yaitu Pencil dan Adobe Photoshop .</p>\r\n	</li>\r\n	<li>\r\n	<h3><strong>Dapat membuat rancangan Database.</strong></h3>\r\n\r\n	<p>Seorang BA juga harus dapat merancang database sesuai dengan hasil analisanya, agar programmer dapat mengerti dengan alur business prosessnya.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>Okay yang terakhir adalah seberapa penting sih kehadiran seorang BA dalam pengembangan suatu product development? Hmmmmm, beberapa ada yang bilang penting, tapi banyak juga software house yang tidak menggunakan jasa si BA ini. Menurut sistem informasi Pada tahap awal sebuah proyek, ketika requirement sudah dibuat oleh tim solusi dan design, peran seorang Business Analyst (BA) adalah untuk meninjau dokumen, bekerja sama dengan perancang solusi (tim TI) dan manajer Proyek untuk memastikan bahwa persyaratan sudah jelas.</p>\r\n\r\n<p>Dalam Perusahaan IT yang berukuran besar, terutama di lingkungan pengembangan, biasanya kita dapat menemukan tim On-site dan tim Offshore seperti gambar di bawah yang memiliki peran yang berbeda. Tugas Seorang Business Analyst adalah sebagai orang yang harus menghubungkan kedua tim tersebut agar dapat berkomunikasi dengan lancar serta menyatukan visi dan misi dalam sebuah project.</p>\r\n\r\n<p>Terkadang, BA akan berinteraksi dengan Business users, technical users dan stakeholders untuk mendapatkan persetujuan dan anggukan terakhir sebelum melanjutkan dokumentasi. Oleh karena itu, peran BA sangat penting dalam jumpstart yang efektif dan kesuksesan untuk setiap proyek.</p>\r\n');
INSERT INTO `mbti_kelas` VALUES (2, 'System Analyst', '<p>System Analyst adalah seorang professional informasi teknologi di bidang analisis, desain, mengiimplementasikan. System Analyst dapat berfungsi sebagai agen perubahan yang mengidentifikasi perbaikan organisasi yang diperlukan, sistem desain untuk menerapkan perubahan-perubahan, dan melatih dan memotivasi orang lain untuk menggunakan sistem.</p>\r\n\r\n<p>System Analyst akrab dengan berbagai bahasa pemrograman, sistem operasi, dan platform perangkat keras komputer tetapi tidak melibatkan diri dalam perangkat keras. Analisa sistem tidak fokus pada&nbsp;<em>hard-coding,</em>&nbsp;tapi lebih pada evaluasi kode dan membuat saran. System Analyst&nbsp;dapat bekerja secara mandiri, tetapi sering merupakan bagian dari unit teknologi informasi yang lebih besar yang membuat aspek teknis dari sebuah perusahaan berjalan lancar.</p>\r\n\r\n<h3>Peran</h3>\r\n\r\n<hr />\r\n<ol>\r\n	<li>\r\n	<p>Mengidentifikasi, memahami dan rencana untuk dampak organisasi dan manusia sistem yang direncanakan, dan memastikan bahwa persyaratan teknis baru yang terintegrasi dengan baik dengan proses yang ada dan keahlian.</p>\r\n	</li>\r\n	<li>\r\n	<p>Merencanakan sistem aliran dari bawah ke atas.</p>\r\n	</li>\r\n	<li>\r\n	<p>Berinteraksi dengan pengguna internal dan pelanggan untuk belajar dan persyaratan dokumen yang kemudian digunakan untuk menghasilkan kebutuhan bisnis dokumen.</p>\r\n	</li>\r\n	<li>\r\n	<p>Menulis persyaratan teknis dari fase kritis.</p>\r\n	</li>\r\n	<li>\r\n	<p>Berinteraksi dengan desainer untuk memahami keterbatasan software.</p>\r\n	</li>\r\n	<li>\r\n	<p>Bantuan programmer selama pengembangan sistem, misalnya menyediakan kasus penggunaan, diagram alur atau bahkan desain database.</p>\r\n	</li>\r\n	<li>\r\n	<p>Melakukan pengujian sistem.</p>\r\n	</li>\r\n	<li>\r\n	<p>Menyebarkan sistem selesai.</p>\r\n	</li>\r\n	<li>\r\n	<p>Konsultasi dengan para pemimpin bisnis untuk menentukan peran sistem IT</p>\r\n	</li>\r\n	<li>\r\n	<p>Setiap kali proses pembangunan dilakukan, analis sistem bertanggung jawab untuk merancang komponen dan memberikan informasi kepada pengembang.</p>\r\n	</li>\r\n	<li>\r\n	<p>Meningkatkan kompatibilitas sistem untuk menyederhanakan berbagi informasi</p>\r\n	</li>\r\n	<li>\r\n	<p>Menghitung memori dan kecepatan persyaratan untuk sistem komputer</p>\r\n	</li>\r\n</ol>\r\n\r\n<h3>Ciri-ciri</h3>\r\n\r\n<hr />\r\n<ol>\r\n	<li>\r\n	<p>Memiliki kemampuan komunikasi verbal dan tertulis yang baik, termasuk keterampilan mendengar aktif.</p>\r\n	</li>\r\n	<li>\r\n	<p>Keterampilan kerja tim</p>\r\n	</li>\r\n	<li>\r\n	<p>Kemampuan interpesonal</p>\r\n	</li>\r\n	<li>\r\n	<p>Kemampuan Menganalisa yang kuat</p>\r\n	</li>\r\n	<li>\r\n	<p>Memiliki kemampuan meneliti</p>\r\n	</li>\r\n</ol>\r\n\r\n<h3>Siklus hidup pengembangan sistem</h3>\r\n\r\n<hr />\r\n<p>Siklus hidup pengembangan sistem (SDLC) adalah metode pengembangan sistem tradisional yang menggunakan organisasi untuk skala besar proyek IT. SDLC adalah kerangka kerja terstruktur yang terdiri dari proses sekuensial dimana suatu sistem informasi dikembangkan.</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>Perencanaan sistem<br />\r\n	Tahap Perencanaan adalah langkah yang paling penting dalam menciptakan sistem yang berhasil, pada tahap ini memutuskan apa yang ingin dilakukan dan jika ada masalah, upaya apa yang harus dilakukan untuk menyelesaikan masalah tersebut</p>\r\n	</li>\r\n	<li>\r\n	<p>Sistem Analisa<br />\r\n	Persyaratan pengguna akhir harus ditentukan dan didokumentasikan, apa harapan mereka untuk sistem, dan bagaimana hal itu akan tampil. Sebuah studi kelayakan akan dilakukan untuk sebuah proyek</p>\r\n	</li>\r\n	<li>\r\n	<p>Sistem Desain<br />\r\n	Tahap desain ini mendefinisikan elemen dari suatu sistem, komponen, tingkat keamanan, modul, arsitektur dan antarmuka yang berbeda dan jenis data yang masuk melalui sistem. Sebuah desain menentukan bagaimana sistem akan terlihat seperti dan bagaimana hal itu akan berfungsi, dan kemudian desain sistem rinci dan diperluas diproduksi, dan akan memenuhi semua kebutuhan fungsional dan teknis, logis dan fisik.</p>\r\n	</li>\r\n	<li>\r\n	<p>Implementasi<br />\r\n	Pada fase ini, sistem siap untuk digunakan dan diinstal di tempat pelanggan, siap menjadi berjalan, hidup dan produktif, pelatihan mungkin diperlukan untuk pengguna akhir untuk memastikan mereka tahu bagaimana menggunakan sistem dan untuk mendapatkan akrab dengan itu, tahap implementasi mungkin memakan waktu lama dan itu tergantung pada kompleksitas sistem dan solusi menyajikan.</p>\r\n	</li>\r\n	<li>\r\n	<p>Pengujian<br />\r\n	Pengujian menjadi lebih dan lebih penting untuk menjamin kepuasan pelanggan, dan tidak membutuhkan pengetahuan dalam coding, konfigurasi hardware atau desain. Pengujian dapat dilakukan oleh pengguna yang sesungguhnya atau oleh tim khusus<br />\r\n	Pengujian dapat menjadi sistematis dan otomatis untuk memastikan bahwa hasil aktual dibandingkan dan sama dengan hasil prediksi dan diinginkan.</p>\r\n	</li>\r\n	<li>\r\n	<p>Pemeliharaan<br />\r\n	Pada fase ini, sistem akan dilakukan untuk memastikan bahwa sistem tidak akan menjadi usang, hal ini mencakup menggantikan hardware lama dan terus menerus mengevaluasi kinerja sistem, itu juga termasuk memberikan update terbaru untuk komponen-komponen tertentu untuk memastikan memenuhi standar yang tepat dan teknologi terbaru untuk menghadapi ancaman keamanan saat ini.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>Enam tahapan System Development Life Cycle merupakan proses berulang untuk setiap proyek. Sangat penting untuk menyebutkan bahwa tingkat komunikasi yang baik harus dipertahankan dengan pelanggan, dan prototype sangat penting dan membantu ketika datang untuk memenuhi persyaratan. Dengan membangun sistem di iterasi pendek; kami dapat menjamin memenuhi kebutuhan pelanggan sebelum kita membangun seluruh sistem.</p>\r\n');
INSERT INTO `mbti_kelas` VALUES (3, 'Programmer', '<p>Apa saja yang harus dikuasai oleh programmer ?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>1. Bahasa Pemrograman</h3>\r\n\r\n<p>Hal ini sangat dan amat wajib untuk dikuasai oleh seorang programmer karena bahasa pemrograman sudah seperti makanan sehari-hari.&nbsp;</p>\r\n\r\n<p>Tanpa bahasa pemrograman, seorang programmer tidak bisa melaksanakan tugasnya yaitu membuat sebuah aplikasi atau mengembangkan web kecuali web yang tanpa bahasa pemrograman sudah bisa dibuat, seperti&nbsp;<a href=\"http://blogger.com/\" rel=\"noopener\" target=\"_blank\">blogger.com</a>, dan&nbsp;<a href=\"http://wordpress.com/\" rel=\"noopener\" target=\"_blank\">wordpress.com</a>.&nbsp;</p>\r\n\r\n<p>Maka dari itu, seorang programmer harus menguasai bahasa pemrograman seperti Java, C++, C, C#, dan lain-lain untuk&nbsp;<em>mobile.</em>&nbsp;Sedangkan untuk web, saya sarankan untuk belajar HTML, PHP, CSS, JavaScript.&nbsp;</p>\r\n\r\n<p>Saran saya, lebih baik&nbsp;kuasai 2 atau 3 bahasa pemrograman saja tetapi mendalami daripada menguasai semua bahasa pemrograman tetapi yang dipelajari hanya kulitnya saja.&nbsp;</p>\r\n\r\n<p>Misalnya kamu ingin menguasai bahasa pemrograman berbasis desktop atau web. Maka kamu harus menguasai minimal 3 bahasa pemrograman untuk desktop atau 3 bahasa pemrograman untuk web.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>2. Bahasa Inggris</h3>\r\n\r\n<p>Seorang programmer harus bisa menguasai bahasa inggris dikarenakan bahasa pemrograman yang terdiri dari perintah-perintah dalam bahasa inggris.&nbsp;</p>\r\n\r\n<p>Mengapa bahasa pemrograman itu memiliki perintah bahasa inggris ? Karena pencipta bahasa pemrograman pertama kalinya itu tinggal di negara dengan bahasa inggris.&nbsp;</p>\r\n\r\n<p>Logikanya begini&hellip;</p>\r\n\r\n<p>Bahasa pemrograman itu saya asumsikan sebagai turis.</p>\r\n\r\n<p>Anggap saja bahasa pemrograman itu turis yang berasal dari negara Inggris, kalau kita bisa menguasai bahasa inggris, pasti kita bisa berkomunikasi dengan sang turis tersebut.</p>\r\n\r\n<p>Begitulah kurang lebihnya tentang pentingnya memiliki kemampuan bahasa inggris untuk menjadi seorang programmer.</p>\r\n\r\n<p>Jadinya perintah dalam bahasa pemrograman pasti menggunakan bahasa inggris.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>3. Logika Yang OK dan Kreativitas Yang Tinggi</h3>\r\n\r\n<p>Seorang programmer dituntut agar bisa menyelesaikan masalah atau membuat aplikasi yang beda dari aplikasi lainnya.&nbsp;</p>\r\n\r\n<p>Maka dari itu, seorang programmer harus mempunyai logika yang OK dan kreativitas yang tinggi supaya dapat menciptakan aplikasi yang berbeda namun tetap masuk akal (logis).&nbsp;</p>\r\n\r\n<p>Seseorang yang mempunyai logika yang tinggi cenderung lebih bisa menyelesaikan masalah lebih cepat bila dibandingkan dengan seseorang yang memiliki logika yang rendah.</p>\r\n\r\n<p>Logika sang programmer itu didapatkan pada saat pelajaran matematika.</p>\r\n\r\n<p>Pada jurusan Teknik Informatika, pasti ada mata kuliah yang berbau dengan yang namanya matematika.</p>\r\n\r\n<p>Mau tidak mau, anda harus bisa matematika agar logika anda bisa terlatih.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>4. Ketelitian Yang Ekstra</h3>\r\n\r\n<p>Hal ini juga penting untuk dimiliki oleh seorang programmer, karena bahasa pemograman itu mempunyai sifat yang sensitif (case sensitive), jadinya kurang satu titik pun program tidak akan bisa jalan.&nbsp;</p>\r\n\r\n<p>Bayangkan jika seorang programmer kurang teliti, maka ia pasti akan pusing untuk melihat letak kesalahannya.&nbsp;</p>\r\n\r\n<p>Nah, itulah fungsi dari adanya debug/compile pada aplikasi untuk membuat program, yaitu untuk mencari letak kesalahan programmer dalam menulis sintaksnya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>5. Kesabaran Yang TOP</h3>\r\n\r\n<p>Ini juga tak kalah penting untuk dikuasai oleh seorang programmer. Programmer yang handal adalah programmer yang bisa menahan diri untuk sabar dalam menjalankan tugasnya yaitu<em>coding&nbsp;</em>atau nama lainnya adalah membuat aplikasi atau web dengan bahasa pemrograman.&nbsp;</p>\r\n\r\n<p>Programmer harus bisa bersabar ketika program yang dibuat masih salah, entah itu kurang sedikit syntax lagi ataupun yang lainnya.</p>\r\n\r\n<p>Karena dengan kesabaran, seorang programmer bisa tenang dalam menjalankan tugasnya. Tidak hanya programmer, setiap orang harus sabar dalam melaksanakan tugasnya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>6. Programmer Harus Rajin dan Pekerja Keras</h3>\r\n\r\n<p>Sebenarnya tidak hanya programmer, tetapi semua orang juga harus rajin dan bekerja keras untuk menekuni profesinya. Seperti kata pepatah, Rajin pangkal Pandai.&nbsp;</p>\r\n\r\n<p>Hal itulah yang membuat seseorang bisa berhasil dalam usahaya mencapai apa yang mereka inginkan. Karena 99% keberhasilan seseorang itu datangnya dari sikap yang rajin dan bekerja keras, dan sisanya 1% untuk doa.</p>\r\n');
INSERT INTO `mbti_kelas` VALUES (4, 'Tester', '<p>Penguji software atau aplikasi merupakan pekerjaan yang menjanjikan di masa sekarang. Salah satu alasannya karena perkembangan berbagai perangkat teknologi memaksa software dan aplikasi untuk mengimbangi perkembangan tetapi tanpa mengurangi kualitas dari software atau aplikasi tersebut. Jika kamu tertarik untuk menjadi penguji tester atau mungkin sudah menjadi penguji software tapi ingin meningkatkan kemampuan berarti kamu harus membaca artikel ini untuk mengetahui apa saja karakter yang wajib kamu miliki.</p>\r\n\r\n<p><strong>Selalu skeptis.</strong>&nbsp;Terdengar aneh tapi ini adalah karakter yang harus dimiliki jika ingin menjadi penguji software atau aplikasi yang baik. Yang dimaksud dengan selalu skeptic adalah ketika tim pengembang memberikan software atau aplikasi untuk duji dengan menggunakan&nbsp;<a href=\"http://www.quadras.co.id/\">testing tool</a>&nbsp;jangan pernah berpikiran atau percaya kalau aplikasi tersebut bebas dari&nbsp;<em>bug</em>&nbsp;atau kualitasnya sudah sesuai dengan kualitas akhir yang diinginkan. Coba dan buktikan sendiri melalui pengujian.</p>\r\n\r\n<p><strong>Terbuka terhadap saran.&nbsp;</strong>Dengar masukan dan&nbsp;<em>feedback&nbsp;</em>dari orang lain sekalipun Anda yang menangani pengujian itu secara keseluruhan. Selalu da ruang untuk melakukan peningkat dan mendapatkan masukan dari sesama teman penguji aplikasi merupakan ide yang bagus. Terlebih jika&nbsp;<em>testing tool.</em></p>\r\n\r\n<p><strong>Mulai lebih awal.&nbsp;</strong>Biasakan untuk memulai pengujian lebih awal dengan melakukan analisa kebutuhan, menyiapkan studi kasus, rencana pengujian dan dokumen strategi pengujian untuk memastikan pengujian itu berjalan dengan lancar dan efisien. Semua persiapan ini akan berguna untuk mengantisipasi beberapa kemungkinan yang bisa terjadi ketika menggunakan&nbsp;<em>testing tool&nbsp;</em>&nbsp;tetapi sebenarnya bisa dihindari.</p>\r\n\r\n<p><strong>Kemampuan mengidentifikasi dan memahami risiko.&nbsp;</strong>Risiko akan selalu menjadi bagian dari pengujian. Langkah terbaik untuk menghadapinya adalah dengan mengelolanya atau yang biasa dikenal dengan istilah manajemen risiko. Manajemen risiko ini merupakan proses yang terdiri dari tiga langkah utama. Mengidentifikasi, menganalisa dan meringankannya.</p>\r\n\r\n<p><strong>Lakukan market research.&nbsp;</strong>Jangan pernah berpikir kalau seorang penguji software atau aplikasi hanya memiliki tanggjung jawab sebatas memvalidasi program sesuai dengan kebutuhan. Tidak ada salahnya menjadi lebih proaktif dengan melakukan&nbsp;<em>market research</em>&nbsp;sesuai dengan software atau aplikasi yang sedang diuji kemudian jangan ragu untuk memberikan masukan yang akan meningkatkan aplikasi tersebut. Market research ini bertujuan untuk memahami pasar lalu menyesuaikannya dengan produk yang sedang diuji.</p>\r\n');
INSERT INTO `mbti_kelas` VALUES (5, 'Technical Support', '<p><strong>Technical Support&nbsp;</strong>adalah seorang programmer juga yang berfokus pada merawat perangkat lunak setelah fase development selesai. bisa juga disebut sebagai software maintenance.</p>\r\n\r\n<p><em>Software maintenance</em>&nbsp;adalah suatu aktivitas yang sangat luas, mencakup semua pekerjaan yang dibuat di suatu sistem perangkat lunak setelah perangkat lunak beroperasi (Martin, 1983&nbsp;<em>dalam</em>&nbsp;Simarmata, 2010). Hal ini meliputi pengoreksian kesalahan, peningkatan, penambahan dan penghapusan kemampuan, adaptasi dalam perubahan kebutuhan data di lingkungan operasi, peningkatan dari pencapaian, kemampuan, atau kualitas yang lain.</p>\r\n\r\n<p>Pemeliharaan sistem (<em>system maintenance</em>) bertujuan untuk:</p>\r\n\r\n<ul>\r\n	<li><strong>Memperbaiki kesalahan</strong></li>\r\n</ul>\r\n\r\n<p>Penggunaan software sistem dapat mengungkapkan kesalahan (<em>bugs</em>) dalam software program atau kelemahan&nbsp;&nbsp;rancangan yang tidak terdeteksi dalam pengujian software sistem. Kesalahan-kesalahan ini dapat diperbaiki.</p>\r\n\r\n<ul>\r\n	<li><strong>Menjaga kemutakhiran&nbsp;<em>(up date)</em>sistem</strong></li>\r\n</ul>\r\n\r\n<p>Perubahan-perubahan sebagai akibat berlalunya waktu mengharuskan modifikasi dalam rancangan atau perangkat lunak (software).</p>\r\n\r\n<ul>\r\n	<li><strong>Meningkatkan sistem</strong></li>\r\n</ul>\r\n\r\n<p>Saat manajer menggunakan sistem, mereka melihat cara-cara membuat peningkatan.&nbsp;&nbsp;Saran-saran ini diteruskan kepada spesialis informasi yang memodifikasi sistem sesuai saran tersebut.</p>\r\n\r\n<p>Berdasarkan tujuannya,&nbsp;<em>software maintenance</em>&nbsp;dibagi menjadi beberapa kategori, yaitu:</p>\r\n\r\n<ul>\r\n	<li>Pemeliharaan korektif (<em>corrective maintenance</em>)</li>\r\n</ul>\r\n\r\n<p>Meliputi semua perubahan yang dibuat dengan mencabut secara nyata kesalahan perangkat lunak.</p>\r\n\r\n<ul>\r\n	<li>Pemeliharaan peningkatan kualitas software (<em>enhancement</em>)</li>\r\n	<li>Pemeliharaan peningkatan kinerja (<em>improvement</em>)</li>\r\n	<li>Pemeliharaan penyesuaian (<em>adaptative&nbsp;maintenance</em>)</li>\r\n</ul>\r\n\r\n<p>Meliputi perubahan yang diperlukan sebagai konsekuensi dari beberapa mutasi di lingkungan tempat sistem itu beroperasi, misalnya mengubah suatu system untuk membuat system tersebut dapat berjalan pada platform hardware baru, sistem operasi, DBMS, TP monitor, dan jaringan.</p>\r\n\r\n<ul>\r\n	<li>Pemeliharaan pencegahan (<em>preventive&nbsp;maintenance</em>)</li>\r\n</ul>\r\n\r\n<p>Isu utama dalam&nbsp;<em>software maintainability</em>&nbsp;suatu sistem informasi adalah aspek pengembangan sistem dan penjagaan sistem dari kerusakan. Software maintenance mengikuti siklus yang dimulai dari menentukan solusi untuk masalah yang ditemukan dan mengimplementasikannya. Salah satu bagian siklus itu adalah pengujian (<em>software testing</em>). Bahkan pengujian yang sangat teliti pada ratusan atau ribuan variabel dan program,&nbsp;<em>user</em>&nbsp;tetap bisa menemukan&nbsp;<em>bugs</em>&nbsp;dari program yang dikembangkan.</p>\r\n\r\n<ul>\r\n	<li>Pemeliharaan penyempurnaan (<em>perfective maintenance</em>)</li>\r\n</ul>\r\n\r\n<p>Mengacu pada perubahan yang dimulai dari permintaan&nbsp;<em>user</em>, contohnya penyisipan, penghapusan, perluasan dan modifikasi fungsi, penulisan ulang dokumentasi, peningkatan kinerja atau kemudahan penggunaan.</p>\r\n');
INSERT INTO `mbti_kelas` VALUES (6, 'Trainer', '<p>Bidang pekerjaan seorang IT Trainer adalah menyampaikan materi-materi pembelajaran yang terkait dengan bidang IT, atau dengan bahasa yang sederhana, bidang pekerjaan utamanya adalah &ldquo;mengajar&rdquo;.</p>\r\n\r\n<h3>Mengawali Karir</h3>\r\n\r\n<p>Jika ingin mencoba berkarir sebagai seorang IT Trainer, hal pertama yang harus diperhatikan adalah &ldquo;fokus&rdquo;. Misal kita ingin menjadi trainer untuk materi programming, maka persempit lagi materi tersebut sampai ke batas paling kecil. Jangan mentang-mentang sudah jadi programmer lantas menghajar semua materi programming yang ada. Jika hal ini terjadi maka biasanya kita tidak akan menguasai materi apapun namun hanya sedikit-sedikit saja. Ingatlah bahwa dunia IT itu teramat sangat luas. Jadi fokuslah dari hal yang paling kecil dan jika sudah mulai menguasai baru lanjutkan ke materi lainnya.</p>\r\n\r\n<p>Setelah menentukan pilihan materi, lanjutkan dengan melatih skill mengajar agar kita terbiasa untuk tampil dan berdiri didepan orang. Kenapa harus dilatih? karena sejujurnya urusan mengajar hingga orang lain bisa mengerti dan memahami apa yang kita sampaikan merupakan hal yang cukup sulit untuk dilakukan.</p>\r\n\r\n<p>Untuk melatih skill mengajar ini, banyak cara yang bisa kita lakukan, misalnya mencoba membuat grup-grup kecil kelompok belajar di kampus lalu kita menawarkan diri untuk menjadi instrukturnya. Atau bisa juga dengan mencoba melatih mata pelajaran komputer di sekolah-sekolah, di lab kampus, hingga ke LPK. Di awal karir, lupakanlah sejenak urusan uang. Dibayar ataupun tidak jangan dipermasalahkan, karena ilmu yang kita dapatkan saat awal-awal mengajar ini yang kelak bisa menjadi bekal ke tahap selanjutnya.</p>\r\n\r\n<p>Jika memang sudah merasa memiliki skill mengajar dan sudah punya keberanian untuk berdiri dan tampil didepan orang lain, barulah kita bisa mencoba untuk mulai mencari kesempatan mengajar di tingkat yang lebih tinggi lagi, misalnya dengan bergabung ke Training Center Professional ataupun menawarkan jasa layanan training ke perusahaan-perusahaan sebagai seorang freelance IT Trainer.</p>\r\n\r\n<h3>Sertifikasi</h3>\r\n\r\n<p>Sertifikasi IT memang tidak mutlak diperlukan, namun jika ada kesempatan, usahakan untuk mengambil sertifikasi ini, karena selain bisa menjadi nilai tambah dalam karir kita juga untuk menguji sudah sejauh mana pemahaman kita terkait dengan materi yang kita ajarkan.</p>\r\n\r\n<p>Lalu jika kebetulan ada kesempatan berikut sarana dan prasarananya, usahakan juga untuk mengambil sertifikat yang khusus diperuntukan bagi kalangan IT Trainer, misalnya seperti&nbsp;<strong>Microsoft Certified Trainer (MCT)</strong>,&nbsp;<strong>Certified Cisco Systems Instructor (CCSI)</strong>,&nbsp;<strong>CompTIA Certified Technical Trainer (CTT+)</strong>,&nbsp;<strong>Certified EC-Council Instructor</strong>, dlsb.</p>\r\n\r\n<p>Keuntungan utama bagi seorang IT Trainer jika memiliki sertifikat semacam ini adalah kemudahan untuk mendapatkan resource pembelajaran dari vendor yang bersangkutan.</p>\r\n\r\n<h3>Tantangan</h3>\r\n\r\n<p>Tantangan paling besar bagi seorang IT Trainer adalah harus selalu belajar dan belajar serta selalu tanggap dengan perkembangan teknologi terkini. Selain itu pengalaman lapangan juga mutlak dibutuhkan. Oleh karenanya, tidak heran jika banyak IT Trainer yang juga terlibat dalam beragam project IT. Tujuannya jelas untuk menambah wawasan, pengetahuan, serta pengalaman dalam menyampaikan materi pembelajaran kelak.</p>\r\n\r\n<h3>Rate</h3>\r\n\r\n<p>Berbicara tentang berapa sih rate bayaran seorang IT Trainer, jelas tidak ada ukuran ataupun standarisasi tertentu. Yang pasti, luasnya pengalaman lapangan, tingginya jam terbang mengajar, serta semakin banyaknya corporate yang menggunakan jasanya, maka sudah pasti ratenya akan semakin tinggi juga.</p>\r\n\r\n<h3>Menjalin Hubungan / Relasi</h3>\r\n\r\n<p>Seorang IT Trainer akan semakin dikenal jika banyak memiliki relasi. Nah, agar mendapat banyak relasi maka cara yang paling mudah saat ini adalah memanfaatkan fitur jejaring sosial / Social Media. Tulislah nama yang jelas berikut kemampuan mengajar pada profil kita di jejaring-jejaring sosial tersebut agar publik mengenal siapa dan apa profesi kita. Gunakan juga signature yang jelas dalam setiap email yang kita kirimkan. Dengan cara seperti ini maka orang-orang akan mudah menemukan kita saat hendak membutuhkan jasa training IT.</p>\r\n\r\n<h3>Berbagi Ilmu</h3>\r\n\r\n<p>Sebagai seorang trainer yang senantiasa menyampaikan materi pembelajaran, sangat disarankan jika di waktu-waktu luang yang ada ikut berbagi ilmu juga ke kalangan publik. Misalnya dengan menulis di blog, menulis ebook, menulis artikel di media cetak, dan lain sebagainya. Selain beramal, hal ini juga menjadi salah satu cara untuk meningkatkan pemahaman kita sekaligus untuk mengingat materi-materi yang kita pegang agar tidak mudah lupa. Dan yang paling utama adalah untuk meningkatkan kemampuan menulis kita. Ingatlah bahwa seorang IT Trainer juga harus terampil dalam menyusun sebuah modul pembelajaran yang terkait dengan materi yang akan diajarkan.</p>\r\n');
INSERT INTO `mbti_kelas` VALUES (7, 'Technical Sales', '<ul>\r\n	<li>Tugas dan Tanggung Jawab : * Membuat perencanaan dan mengatur taktik penjualan dari seluruh produk-produk yang diperdagangkan/ diwakili Perusahaan.</li>\r\n	<li>* Mengadakan kunjungan kepada Petenak pemakai dan calon pemakai untuk mempromosikan produk-produk yang diperdagangkan oleh Perusahaan.</li>\r\n	<li>* Membuat dan mengarahkan para Peternak dan Poultry Shops demi tercapainya target penjualan dari produk-produk tersebut di atas secara maksimal disertai kontrol yang baik terhadap batas kredit dan pembayaran dari masing-masing pelanggan.</li>\r\n	<li>* Mengadakan pengawasan atas persediaan barang, baik di tingkat Poultry Shop, Peternak maupun di tingkat Cabang.</li>\r\n	<li>* Membuat Laporan Penjualan dan perkembangan produk-produk yang dipromosikan.</li>\r\n	<li>* Membantu Poultry Shop mempromosikan produk tersebut di atas kepada peternaknya.</li>\r\n	<li>* Mengatasi keluhan dan kesulitan-kesulitan dari pelanggan di dalam pemakaian produk-produk tersebut di atas dalam rangka memantapkan pemasaran produk-produk tersebut.</li>\r\n	<li>* Memberikan Penyuluhan-penyuluhan kepada Peternak/ Kelompok Peternak dengan tujuan agar Peternak memahami secara teknis prinsip serta penggunaan produk-produk Perusahaan.</li>\r\n	<li>* Melakukan penagihan atas piutang yang sudah jatuh tempo dan mengusahakan agar selalu mencapai target Collection setiap bulan yang telah ditentukan.</li>\r\n	<li>&nbsp;</li>\r\n	<li>Tugas-tugas Khusus: * Khususnya untuk segi-segi teknis dari produk-produk Perusahaan, dari waktu ke waktu akan menerima training yang diberikan baik oleh Supplier maupun oleh staff Managemen Perusahaan.</li>\r\n	<li>* Menjalin hubungan kerja/ kerjasama yang baik dengan para pelanggan dalam jangka panjang dengan mengadakan kunjungan-kunjungan yang teratur ke lapangan.</li>\r\n	<li>* Terus menerus mengusahakan agar produk-produk Perusahaan memperoleh &ldquo;Market Share&rdquo; tertinggi di antara produk-produk pesaing.</li>\r\n	<li>* Memberitahu kepada atasan mengenai informasi-informasi pasar, harga-harga serta cara-cara promosi pesaing dari waktu ke waktu.</li>\r\n	<li>* Memberikan saran-saran yang positif demi pengembangan Perusahaan.</li>\r\n	<li>* Membuat rencana kerja yang teratur dan memberikan pertanggungjawaban perihal hasil pekerjaannya kepada atasannya.</li>\r\n	<li>* Mempertanggungjawabkan semua biaya-biaya pengeluaran sesuai dengan batas-batas yang telah ditetapkan.</li>\r\n	<li>&nbsp;</li>\r\n	<li>Kriteria Penilaian: * Keberhasilan mencapai Sales Target</li>\r\n	<li>* Keberhasilan dalam mengontrol batas waktu kredit para pelanggan dan melakukan penagihan dari faktur-faktur yang jatuh tempo.</li>\r\n	<li>* Hubungan baik dengan langganan dan rekan sekerja.</li>\r\n	<li>* Keberhasilan mengembangkan langganan-langganan baru.</li>\r\n	<li>* Inisiatif/ usul-usul yang positif demi tercapainya metode/ prosedur yang lebih baik.</li>\r\n	<li>* Ketepatan pelaksanaan tugas.</li>\r\n	<li>* Keberhasilan mengembangkan dan memantapkan Product Image di daerah yang diberikan kepada Saudara</li>\r\n</ul>\r\n');
