INSERT INTO `skkni_unit` VALUES ('UK001', 'J.620100.001.01', 'Menganalisis tools', 'Unit ini menentukan kompetensi, pengetahuan dan sikap kerja yang diperlukan untuk menganalisis tools yang diperlukan untuk mengembangkan perangkat lunak aplikasi sesuai dengan kebutuhan.');
INSERT INTO `skkni_unit` VALUES ('UK002', 'J.620100.002.01', 'Menganalisis skalabilitas perangkat lunak', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam menganalisis skalabilitas perangkat lunak untuk tujuan implementasi.');
INSERT INTO `skkni_unit` VALUES ('UK003', 'J.620100.003.01', 'Melakukan Identifikasi Library, Komponen atau Framework yang diperlukan', 'Unit ini menentukan kompetensi, pengetahuan dan Sikap kerja yang diperlukan untuk pencarian, pengembangan proof of concept, dan penentuan library, komponen atau framework dari open source hingga proprietary untuk dapat dimanfaatkan pada pekerjaan pembangunan perangkat lunak.');
INSERT INTO `skkni_unit` VALUES ('UK004', 'J.620100.006.01', 'Merancang User Experience', 'Unit ini menentukan kompetensi yang diperlukan untuk membuat rancangan user experience untuk aplikasi yang dikembangkan.');
INSERT INTO `skkni_unit` VALUES ('UK005', 'J.620100.008.01', 'Merancang Arsitektur aplikasi', 'Unit ini menentukan kompetensi yang diperlukan untuk membuat rancangan arsitektur dari aplikasi yang dikembangkan.');
INSERT INTO `skkni_unit` VALUES ('UK006', 'J.620100.014.01', 'Menerapkan metode dan praktik penggunaan kembali (reusable) subrutin-subrutin', 'Unit ini mengukur kemampuan programmer dalam merancang, mengimplementasikan, dan menggunakan kembali subrutin (fungsi/prosedur/modul) untuk membuat program.');
INSERT INTO `skkni_unit` VALUES ('UK007', 'J.620100.015.01', 'Menyusun fungsi, file atau sumber daya pemrograman yang lain dalam organisasi yang rapi', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam mengorganisasikan sumber daya hasil pemrogramannya seperti source code, file referensi, dokumentasi, dll dalam organisasi yang rapi sehingga memudahkan diri sendiri maupun orang lain dalam mengakses dan menggunakan sumber daya tersebut.');
INSERT INTO `skkni_unit` VALUES ('UK008', 'J.620100.019.02', 'Menggunakan library atau komponen pre-existing', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang diperlukan untuk menggunakan komponen-komponen reuse (yang dapat dipergunakan secara berulang) untuk mendukung pengembangan aplikasi yang efisien.');
INSERT INTO `skkni_unit` VALUES ('UK009', 'J.620100.024.02', 'Melakukan migrasi ke teknologi baru', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam meningkatkan kinerja organisasi dengan menggunakan teknologi pemrograman terkini.');
INSERT INTO `skkni_unit` VALUES ('UK010', 'J.620100.026.01', 'Menerapkan Source code Versioning', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang diperlukan dalam menerapkan metode dan tools untuk mencatat versi dari setiap program sumber.');
INSERT INTO `skkni_unit` VALUES ('UK011', 'J.620100.031.01', 'Melakukan Profiling Program', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam upaya investigasi performa, waktu eksekusi dari suatu program dalam upaya melakukan optimasi program.');
INSERT INTO `skkni_unit` VALUES ('UK012', 'J.620100.034.02', 'Melaksanakan pengujian Integrasi program', 'Unit kompetensi ini mendeskripsikan sikap, kemampuan dan pengetahuan untuk melakukan pengujian integrasi dari setiap modul program yang telah dibuat.');
INSERT INTO `skkni_unit` VALUES ('UK013', 'J.620100.035.02', 'Melaksanakan pengujian Program Sistem', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam melaksanakan pengujian sistem dari seluruh arsitektur program yang telah dibuat.');
INSERT INTO `skkni_unit` VALUES ('UK014', 'J.620100.037.01', 'Melaksanakan Stress Test', 'Unit kompetensi ini berhubungan dengan melaksanakan stress test untuk menguji aplikasi dengan karakteristik load sedekat mungkin dengan load sewaktu production.');
INSERT INTO `skkni_unit` VALUES ('UK015', 'J.620100.041.01', 'Melaksanakan Cutover aplikasi', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan untuk melaksanakan perpindahan dari penggunaan aplikasi  lama ke aplikasi baru (cutover aplikasi) dengan menggunakan mekanisme yang paling sesuai dengan situasi dan kondisi.');
INSERT INTO `skkni_unit` VALUES ('UK016', 'J.620100.042.01', 'Melaksanakan Konfigurasi Perangkat Lunak Sesuai Environment (Development, Staging, Production)', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan untuk melakukan konfigurasi perangkat lunak sesuai environment.');
INSERT INTO `skkni_unit` VALUES ('UK017', 'J.620100.043.01', 'Menganalisis dampak perubahan terhadap aplikasi', 'Unit ini berkaitan dengan analisis dampak development effort yang muncul dari adanya permintaan perubahan aplikasi dari stakeholder.');
INSERT INTO `skkni_unit` VALUES ('UK018', 'J.620100.045.01', 'Melakukan pemantauan resource yang digunakan aplikasi', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang berkaitan dengan pemantauan resource yang digunakan aplikasi.');
INSERT INTO `skkni_unit` VALUES ('UK019', 'J.620100.004.02', 'Menggunakan struktur data', 'Unit ini menentukan kompetensi, pengetahuan dan sikap kerja  yang diperlukan dalam mempelajari dan membuat struktur data yang akan diterapkan pada pemrograman, tanpa tergantung bahasa pemrograman yang akan dipakai.');
INSERT INTO `skkni_unit` VALUES ('UK020', 'J.620100.010.01', 'Menerapkan perintah eksekusi bahasa pemrograman berbasis text, grafik, dan multimedia', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan untuk dapat menjalankan code yang dibuat pada lingkungan tools pemrograman tertentu.');
INSERT INTO `skkni_unit` VALUES ('UK021', 'J.620100.017.02', 'Mengimplementasikan pemrograman terstruktur', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan untuk membuat program  terstruktur atau prosedural.');
INSERT INTO `skkni_unit` VALUES ('UK022', 'J.620100.020.02', 'Menggunakan SQL', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan untuk menggunakan perangkat aplikasi berbasis data deskripsi atau SQL (Structured Query Language) pada aspek DML-Data Manipulation Language.');
INSERT INTO `skkni_unit` VALUES ('UK023', 'J.620100.021.02', 'Menerapkan akses basis data', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan untuk membuat program yang mengakses basis data suatu sistem manajemen basis data.');
INSERT INTO `skkni_unit` VALUES ('UK024', 'J.620100.022.02', 'Mengimplementasikan algoritma pemrograman', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam menerapkan algoritma pada setiap pemrograman, tanpa tergantung bahasa pemrograman yang akan dipakai.');
INSERT INTO `skkni_unit` VALUES ('UK025', 'J.620100.025.02', 'Melakukan debugging', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam memeriksa kode program dari kesalahan (bug).');
INSERT INTO `skkni_unit` VALUES ('UK026', 'J.620100.033.02', 'Melaksanakan pengujian unit program', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam melakukan uji coba unit program.');
INSERT INTO `skkni_unit` VALUES ('UK027', 'J.620100.007.01', 'Mengimplementasikan rancangan Entitas dan Keterkaitan antar Entitas', 'Unit ini menentukan kompetensi, pengetahuan dan Sikap kerja yang diperlukan untuk mengimplementasikan rancangan entitas dan keterkaitannya yang diperlukan sebagai dasar basis data yang dibuat.');
INSERT INTO `skkni_unit` VALUES ('UK028', 'J.620100.009.01', 'Menggunakan spesifikasi program', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan untuk dapat memahami spesifikasi hasil perancangan program (termasuk Context Diagram (DCD), Data Flow Diagram (DFD), Entity Relationship Diagram (ERD), diagram objek, diagram komponen, class/modul program, properti class, tabel dan deskripsinya) dan menggunakannya.');
INSERT INTO `skkni_unit` VALUES ('UK029', 'J.620100.012.01', 'Melakukan pengaturan software tools pemrograman', 'Unit ini mengukur kemampuan programmer dalam melakukan setting lingkungan pemrograman yang akan digunakan dalam pekerjaan membuat program.');
INSERT INTO `skkni_unit` VALUES ('UK030', 'J.620100.018.02', 'Mengimplementasikan pemrograman berorientasi objek', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam membuat perangkat lunak aplikasi dalam bahasa pemrograman berorientasi objek.');
INSERT INTO `skkni_unit` VALUES ('UK031', 'J.620100.040.01', 'Membuat paket Instalasi perangkat lunak', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam melakukan instalasi perangkat lunak sesuai dengan alat atau mesinnya tanpa memerlukan kode sumber asalnya.');
INSERT INTO `skkni_unit` VALUES ('UK032', 'J.620100.046.01', 'Mengimplementasikan fitur logging aplikasi', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam penerapan pengelolaan log aplikasi.');
INSERT INTO `skkni_unit` VALUES ('UK033', 'J.620100.047.01', 'Melakukan pembaharuan perangkat lunak', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam kaitan dengan pembaharuan perangkat lunak.');
INSERT INTO `skkni_unit` VALUES ('UK034', 'J.620100.005.02', 'Mengimplementasikan User Interface', 'Unit ini menentukan kompetensi, pengetahuan dan Sikap kerja yang diperlukan dalam membuat rancangan antar muka program.');
INSERT INTO `skkni_unit` VALUES ('UK035', 'J.620100.011.01', 'Melakukan instalasi software tools pemrograman', 'Unit ini mengukur kemampuan programmer dalam melakukan instalasi lingkungan pemrograman yang akan digunakan dalam pekerjaan membuat program.');
INSERT INTO `skkni_unit` VALUES ('UK036', 'J.620100.016.01', 'Menulis kode dengan prinsip sesuai guidelines dan best practices', 'Unit ini menentukan kompetensi, pengetahuan dan Sikap kerja yang diperlukan dalam menerapkan prinsip penulisan kode yang baik agar kode tersebut dapat dirawat (maintainability).');
INSERT INTO `skkni_unit` VALUES ('UK037', 'J.620100.023.02', 'Membuat dokumen kode program', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang yang diperlukan untuk membuat dokumentasi dari kode program yang telah ditulis secara hardcopy termasuk  identifikasi penjelas dari dokumen tersebut.');
INSERT INTO `skkni_unit` VALUES ('UK038', 'J.620100.032.01', 'Menerapkan Code Review', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan untuk melakukan code review dalam rangka menganalisis kesesuaian kode dengan coding guidelines dan best-practices.');
INSERT INTO `skkni_unit` VALUES ('UK039', 'J.620100.038.01', 'Melaksanakan Pengujian Oleh Pengguna (UAT)', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam melaksanakan pengujian oleh pengguna, biasa disebut dengan istilah User Acceptance Test (UAT) untuk mengetahui kelayakan dan kesesuaian aplikasi.');
INSERT INTO `skkni_unit` VALUES ('UK040', 'J.612000.001.01', 'Menunjukkan Platform Operating System dan Bahasa Pemrograman di dalam Perangkat Lunak', 'Unit ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja yang dibutuhkan dalam menunjukkan sistem operasi dan bahasa pemrograman berdasarkan platform dan device yang digunakan oleh user.');
INSERT INTO `skkni_unit` VALUES ('UK041', 'J.612000.002.01', 'Merancang Mobile Network Programming', 'Unit ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja yang dibutuhkan dalam mengukur keterampilan programming khususnya untuk memenuhi kebutuhan mobile network programming.');
INSERT INTO `skkni_unit` VALUES ('UK042', 'J.612000.003.01', 'Merancang Database dan Data Persistence pada Mobile Data', 'Unit ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja yang dibutuhkan dalam penyimpanan data pada aplikasi mobile dengan menggunakan internal atau eksternal storage dan sqlite database serta penyimpanan data pada layer terpisah dari perangkat mobile.');
INSERT INTO `skkni_unit` VALUES ('UK043', 'J.612000.004.01', 'Membuat Multimedia Messaging Application pada Mobile Computing', 'Unit ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja yang dibutuhkan dalam membuat dan mengirimkan multimedia message dilihat dari sudut pandang konten, aplikasi dan layanan telekomunikasi.');
INSERT INTO `skkni_unit` VALUES ('UK044', 'J.612000.005.01', 'Merancang Pemrograman pada Mobile Network Element', 'Unit ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja yang dibutuhkan dalam melakukan pemrograman dalam pengembangan aplikasi client  server yang dapat diaplikasikan pada mobile technology.');
INSERT INTO `skkni_unit` VALUES ('UK045', 'J.612000.006.01', 'Menyusun Mobile Location Based Service, GPS dan Mobile Navigation.', 'Unit ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja yang dibutuhkan dalam menyusun rencana prosedur penggunaan LBS, GPS dan navigasi pada perangkat bergerak.');
INSERT INTO `skkni_unit` VALUES ('UK046', 'J.612000.007.01', 'Merancang Mobile Interface', 'Unit ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja yang dibutuhkan dalam merancang Interface yang menarik sehingga aplikasi berbasis mobile dapat digunakan dengan baik, serta dapat mengidentifikasi ketertarikan user terhadap aplikasi berbasis mobile yang dikembangkan.');
INSERT INTO `skkni_unit` VALUES ('UK047', 'J.612000.008.01', 'Menjelaskan Dasar-dasar Mobile Security', 'Unit ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja yang dibutuhkan dalam mengukur pemahaman mengenai dasar-dasar Mobile Communication Security.');
INSERT INTO `skkni_unit` VALUES ('UK048', 'J.612000.018.01', 'Merancang Penggunaan dan Pengembangan Mobile API', 'Unit ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja yang dibutuhkan dalam merancang penggunaan Mobile API dan pengembangannya sesuai kebutuhan user.');
INSERT INTO `skkni_unit` VALUES ('UK049', 'J.620100.027.01', 'Mengimplementasikan network programming', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam mengimplementasikan network programming sebagai mekanisme komunikasi antar proses.');
INSERT INTO `skkni_unit` VALUES ('UK050', 'J.620100.028.02', 'Menerapkan pemrograman Real Time', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam membuat pemahaman teknik pemrograman real time.');
INSERT INTO `skkni_unit` VALUES ('UK051', 'J.620100.029.02', 'Menerapkan pemrograman Paralel', 'Unit ini menentukan kompetensi, pengetahuan dan sikap kerja yang berhubungan dengan teknik pemrograman paralel yang berisikan banyak task/job untuk menyelesaikan pekerjaan tersebut.');
INSERT INTO `skkni_unit` VALUES ('UK052', 'J.620100.013.01', 'Menerapkan pemecahan permasalahan menjadi subrutin', 'Unit kompetensi ini berhubungan dengan sikap, pengetahuan, dan keterampilan yang dibutuhkan dalam memecah permasalahan menjadi permasalahanpermasalahan yang lebih kecil dan menyelesaikan permasalahan lebih kecil tersebut berupa fungsi, prosedur, library, atau representasi yang lain sesuai paradigma bahasa pemrograman yang digunakan.');
INSERT INTO `skkni_unit` VALUES ('UK053', 'J.631120.001.01', 'Mendefinisikan Terminologi dan Konsep Cloud Computing', 'Unit kompetensi ini berhubungan dengan kemampuan untuk mendefinisikan terminologi dan konsep cloud computing, karakteriktik cloud computing, model pengantaran layanan cloud computing, model cloud computing deployment. Selain itu juga mendefinisikan biaya dan manfaat cloud computing, SLA (Service Level Agreement) cloud computing dan menguraikan topologi jaringan komputer untuk sistem cloud computing.');
INSERT INTO `skkni_unit` VALUES ('UK054', 'J.631120.010.01', 'Melakukan Adaptasi untuk Deployment di Environment Cloud', 'Unit kompetensi ini berhubungan dengan kemampuan mengidentifikasi fitur layanan dan jenis pengguna untuk memberikan kemudahan beradaptasi dalam deployment di sistem Cloud.');
INSERT INTO `skkni_unit` VALUES ('UK055', 'J.631120.011.01', 'Mengembangkan Perangkat Lunak Sesuai dengan Deployment Environment', 'Unit kompetensi ini berhubungan dengan pengetahuan dan keterampilan dalam membangun perangkat lunak sesuai dengan fitur layanan dan jenis pengguna hingga menjadi perangkat lunak yang sempurna, menguji perangkat lunak yang dikembangkan serta mendokumentasikan pengembangan perangkat lunak.');
INSERT INTO `skkni_unit` VALUES ('UK056', 'J.631120.012.01', 'Memetakan Kebutuhan Aplikasi dari User ke Solusi Cloud', 'Unit kompetensi ini berhubungan dengan kemampuan dalam mendeskripsikan variasi aplikasi yang bisa menjadi solusi untuk user, menyusun solusi aplikasi, serta mendokumentasikan peta kebutuhan aplikasi dari user terhadap solusi aplikasi cloud.');
INSERT INTO `skkni_unit` VALUES ('UK057', 'J.612000.022.01', 'Menjelaskan mobile sensor dan spesifikasi teknisnya untuk mobile computing', 'Unit kompetensi ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja dalam menunjukkan sensor-sensor yang terdapat pada mobile computing.');
INSERT INTO `skkni_unit` VALUES ('UK058', 'J.612000.025.01', 'Menentukan mobile seluler network', 'Unit ini berhubungan dengan pengetahuan, keterampilan dan sikap kerja yang dibutuhkan dalam mengidentifikasikan mobile celular network untuk melakukan data komunikasi bagi mobile user.');
